void black_scholes2_loop::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"S\" :  \"" << S.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"E\" :  \"" << E.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"r\" :  \"" << r.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"sigma\" :  \"" << sigma.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"T\" :  \"" << T.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"rand_number_address0\" :  \"" << rand_number_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"rand_number_ce0\" :  \"" << rand_number_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"rand_number_q0\" :  \"" << rand_number_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"store_address0\" :  \"" << store_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"store_ce0\" :  \"" << store_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"store_we0\" :  \"" << store_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"store_d0\" :  \"" << store_d0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"M\" :  \"" << M.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_return\" :  \"" << ap_return.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

